import React from 'react';
import logo from '../assets/Logo/Logo-brainflix.svg';
import search from '../assets/Icons/SVG/Icon-search.svg';

export default function Header() {
    return (
        <>
            <div className="header">
                <img className="header__logo" src={logo} alt="Brainflix" />
                <div className="header__search-box">
                    <button><img className="header__search-icon" src={search} alt="" /></button>
                    <input type="text" placeholder="Search"></input>
                </div>
                {/* <input className="header__search" type="search" value="" placeholder="Search" /> */}
                <button className="header__upload">+ UPLOAD</button>
            </div>
        </>
    );
}


